import React from "react";
import Header from "./Header";


function App() {

  return (
    <div>
      <Header />
      <div className="calculator">
        <button>1</button>
        <button>2</button>
        <button>3</button>
        <button>4</button>
      </div>
    </div>
  );
}

export default App;
